import React from 'react';
import './App.css';
import SignIn from './molecules/SignIn';
import SignUp from './molecules/SignUp';
import { BrowserRouter as Router, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <div>
          <Route path="/signup" component={SignUp} />
        </div>
      </Router>
      <SignIn />
    </div>
  );
}

export default App;
